import { useState , useEffect} from "react"

const LoginJ = () => {
  
  const log=()=>{
      axios.get('http://localhost:1234/Users/getbyid').then
    }
  return <div>
      <input type="text" id="nameI" placeholder='Enter name'></input>
      <input id="passwordI" placeholder='Enter password'></input> 
      <input type='submit' onClick={()=>log()}></input> 
    </div>
  
}

export default LoginJ
